import React from 'react';
import Link from 'next/link';
import About from './about';


const Index  = () => {
    
    return(
        <div>
            <h1>Fitness!</h1>
            <ul>
                <li>
                    Workout!
                </li>
                <Link href="/about"><li>
                    About us
                </li>
                </Link>
            </ul>
        </div>
    )
}

export default Index;
